import React, { Component } from 'react';
import { DetailWrapper, Header, Content } from './style';

class Detail extends Component {
  render() {
    return (
      <DetailWrapper>
        <Header>衡水中学，被外地人占领的高考工厂</Header>
        <Content></Content>
      </DetailWrapper>
    )
  }
}

export default Detail;
